import raw from './assets/sample.txt';

class map
{

      constructor()
      {
            this.map_height = 0;
            this.map_width = 0;
            this.getstuff();
      }

      getstuff()
      {
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  text.split('\n');
                  text.trim();
                  this.map_width = text[3];
                  this.map_height = text[6];
      
            })
      }

}
 
export default map;
